import { FC } from "react";

type Props = {};
const Login: FC<Props> = () => {
  return (
    <div className="border border-red-600 flex justify-center mt-20">
      <form className="">
        <p className="text-center text-xl">Model Fashion Dashboard</p>
        <input
          type="text"
          placeholder="Email"
        />
        <input
          type="text"
          placeholder="Password"
        />
        <p>ok</p>
      </form>
    </div>
  );
};

export default Login;
